import './Card.css'
import {projects} from './Project';

function Card({prop}){
    return(
        <div className='card-item'>
            <div className='card-text'>
                <div className='card-title'>{prop.title}</div>
                <div>{prop.description}</div>
            </div>
            <img src={prop.image}></img>
        </div>
    )
}
export default Card;
